<!DOCTYPE html>
<html lang="he" dir="rtl">
<head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0"/>

    <title>ריאל מדריד - גלאקטיקוס</title>

    <style>
        body {
            margin: 0;
            font-family: Arial, sans-serif;
            background: #fefefe;
            color: #333;
        }
        .container {
            display: flex;
            flex-direction: column;
            min-height: 100vh;
        }
        header, footer {
            text-align: center;
            padding: 20px;
            background: #ffffff;
        }

        /* Hero Section */
        .hero {
            flex: 1;
            background: #000;
            position: relative;
            color: #fff;
            overflow: hidden;
            display: flex;
            align-items: center;
            justify-content: center;
        }
        .hero img {
            width: 100%;
            height: auto;
            object-fit: cover;
            opacity: 0.6;
        }
        .hero .overlay {
            position: absolute;
            top: 0; left: 0; right: 0; bottom: 0;
            background: linear-gradient(to bottom, rgba(0,0,0,0.3), rgba(0,0,0,0.7));
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            padding: 20px;
            text-align: center;
        }
        .hero h1 {
            font-size: 2rem;
            margin: 10px 0;
        }
        .hero p {
            font-size: 1.2rem;
            margin-bottom: 20px;
        }
        .hero a {
            display: inline-block;
            text-decoration: none;
            background: #00b4d8;
            color: #ffffff;
            font-weight: bold;
            padding: 15px 30px;
            border-radius: 50px;
            transition: background 0.3s ease;
        }
        .hero a:hover {
            background: #0077a5;
        }

        /* Responsive */
        @media (max-width: 600px) {
            .hero h1 {
                font-size: 1.6rem;
            }
            .hero p {
                font-size: 1rem;
            }
            .hero a {
                padding: 12px 20px;
                font-size: 1rem;
            }
        }

        /* Footer */
        footer {
            background: #f1f1f1;
            font-size: 0.9rem;
            color: #555;
        }
    </style>
</head>
